import React from 'react';
import './App.css';
import Crossword from '@jaredreisinger/react-crossword';

const data = {
  across: {
    1: {
      clue: 'First letter of greek alphabet',
      answer: 'alpha',
      row: 0,
      col: 0,
    },
    3: {
      clue: 'Not cold',
      answer: 'hot',
      row: 0,
      col: 2,
    },
  },
  down: {
    1: {
      clue: 'Something we breathe',
      answer: 'air',
      row: 0,
      col: 0,
    },
    2: {
      clue: 'A number',
      answer: 'two',
      row: 0,
      col: 1,
    },
  },
};


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Crossword data={data} />
      </header>
    </div>
  );
}

export default App;
